struct Solution;

impl Solution {
    pub fn length_of_longest_substring(s: String) -> i32 {
        if s.is_empty() || s.len() == 1 {
            return s.len() as i32;
        }

        let s: Vec<char> = s.chars().collect();
        let mut dp: Vec<Vec<i32>> = vec![vec![0; s.len()]; s.len()];
        dp[0][0] = 1;

        for i in 1..s.len() {
            if s[i] != s[0] {
                dp[0][i] = dp[0][i - 1] + 1;
            } else {
                break;
            }
        }

        for i in 1..s.len() {
            let mut cur_line_max = 1;
            for j in i..s.len() {
                if i == j {
                    dp[i][j] = cur_line_max.max(dp[i - 1][j]).max(dp[i - 1][j - 1]);
                } else if s[i] != s[j] {
                    cur_line_max += 1;
                    dp[i][j] = cur_line_max.max(dp[i - 1][j]).max(dp[i][j - 1]);
                } else {
                    break;
                }
            }
        }

        dp[s.len() - 1][s.len() - 1]
    }
}

